●早回しに最適なスイスグリップ六角ドライバーです。●スイスグリップはポリプロピレン・サントプレンの２種の新素材からなるハンドルです。●ハンドル形状は人間工学的デザインに基づいたマルチクラフトと同型です。●厳選された表面素材は人間の手の硬度に近く、従来のPBハンドルの特性が、軟らかく温かみのあるスイスグリップにより更に引き出されています。●ハンドル後部にはドライバーの先端形状のシンボルマークとサイズを表示していますので、作業に適したドライバーをすぐに選ぶことができます。●特殊な表面構造により、濡れた手で握っても滑りにくく、さらにオイル・ガソリンに耐性があり、汚れてもきれいに落とせます。<br>●全長(mm)／300●対辺寸法(mm)／8.00●軸長(mm)／180<br>●メーカー／ＰＢスイスツールズ<br>●型番／2303068<br>●JANコード／7610733079155<br><br>代表画像（画像はイメージです。）<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<br><br>※本商品はメーカーより取寄せ後の発送となるため、配送日はご指定頂けません。予めご了承ください。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

